function dailyreport_to_pdf(t){var a="header_report_detail_to_pdf.php";$.ajax({url:a,cache:!1,dataType:"json",type:"POST",data:{report_id:t},error:function(){console.log("Request Error")}}).done(function(t){console.log("Return: "+t.message),$("#btn-pdf-export").fadeIn()}).error()}function getGraph(t){var a="api.report.php",e=$("#year").val(),o=$("#month").val(),r=$("#line").val();$.ajax({url:a,cache:!1,dataType:"json",type:"GET",data:{calling:"report",action:"getGraph",year:e,month:o,shift:t,line:r},error:function(){console.log("Request Error")}}).done(function(a){$("#container-"+t).highcharts({title:{text:"Shift "+a.data.shift+", Line "+a.data.line+", "+a.data.month+" "+a.data.year,x:-20},xAxis:{categories:a.data.date},yAxis:{title:{text:"%"}},tooltip:{valueSuffix:"%"},series:[{name:"Actual yield",data:a.data.actual_yield},{name:"Taget output",data:a.data.target_output},{name:"Actual output",data:a.data.actual_output},{name:"Product EFF",data:a.data.product_eff},{name:"Total EFF",data:a.data.total_eff}]})}).error()}